import { createGlobalStyle } from 'styled-components';
import Bars from './components/Bars';

const GlobalStyle = createGlobalStyle`
  body{
    background: #FFF;
    }
`;

const App = () => {
  return (
    <>
      <GlobalStyle />
      <Bars></Bars>
    </>
  );
}


export default App;
